import React from 'react';
import './StudentHome.css';
import TopBar from '../components/TopBar';
import InternshipCard from '../components/InternshipCard';
import ProfileOverview from '../components/ProfileOverview';

// import your icons:
import internshipIcon from '../assets/icons/internships-icon.png';
import applicationIcon from '../assets/icons/application-icon.png';
import evalIcon from '../assets/icons/eval-icon.png';
import profileIcon from '../assets/icons/profile-icon.png';

const StudentHome = () => {
  const internships = [
    { id: 1, title: 'Software Engineering Intern', company: 'Google', location: 'Berlin', salary: 'Paid', duration: '3 Months', date: '3 days ago', early: true },
    { id: 2, title: 'Marketing Intern',           company: 'Unilever', location: 'Hamburg', salary: 'Unpaid', duration: '2 Months', date: '3 days ago', early: true },
    { id: 3, title: 'Data Analyst Intern',         company: 'SAP',      location: 'Munich', salary: 'Paid', duration: '1 Month',  date: '2 days ago', early: false },
  ];

  return (
    <div className="dashboard-container">
      <TopBar />

      {/* page-specific button nav */}
      <div className="student-page-nav">
        <button className="page-nav-button">
          <img src={internshipIcon} alt="Internships" />
          <span>Internships</span>
        </button>
        <button className="page-nav-button">
          <img src={applicationIcon} alt="Applications" />
          <span>Applications</span>
        </button>
        <button className="page-nav-button">
          <img src={evalIcon} alt="Evaluations" />
          <span>Evaluations</span>
        </button>
        <button className="page-nav-button">
          <img src={profileIcon} alt="Profile" />
          <span>Profile</span>
        </button>
      </div>

      <div className="main-content">
        <aside className="sidebar">
          <ProfileOverview />
        </aside>

        <section className="internship-section">
          <h2 className="section-title">Suggested for you!</h2>
          <div className="internship-cards">
            {internships.map(i => (
              <InternshipCard key={i.id} {...i} />
            ))}
          </div>
        </section>
      </div>

      <footer className="footer">
        <p>GUC Internship Platform Â© 2025</p>
      </footer>
    </div>
  );
};

export default StudentHome;
